import React from 'react';
import { Container, Typography, Box, Grid, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';

// Styled components
const ServiceCategory = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(3),
  textAlign: 'center',
  width: '100%',
  maxWidth: '400px', // Adjust this value as needed
  boxSizing: 'border-box',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
}));

const EyelashExtensionPage = () => {
  return (
    <Container className="container">
      <Box mt={4} mb={4}>
        <Typography variant="h2" align="center" gutterBottom>
          Eyelash Extensions
        </Typography>

        {/* Services Price Chart */}
        <Grid container spacing={4} mt={4}>
          <Grid item xs={12} sm={6} md={4}>
            <ServiceCategory elevation={3}>
              <Typography variant="h5" gutterBottom>
                Full New Set <br />80 Lashes Per Eye <br />$140
              </Typography>
              <Box p={4}>
                <Typography variant="body1">2 Weeks Touch Up (8-14 Days) - $70</Typography>
                <Typography variant="body1">3 Weeks Touch Up (15-21 Days) - $90</Typography>
              </Box>
            </ServiceCategory>
          </Grid>

          {/* Repeat Grid items here... */}

        </Grid>
      </Box>
    </Container>
  );
};

export default EyelashExtensionPage;
